function Header() {
  return (
    <header>
      <h1>Diocane</h1>
      <nav>
        <ul>
            <li><a href="#">Home</a></li>
            <li>About</li>
            <li>Services</li>
            <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
}
export default Header;
